			$(".main_morgage"+mp_id+" #loanTerm").addClass("sl_loan_app_period_"+mp_id);
			$(".main_morgage"+mp_id+" #PMI").addClass("sl_home_loan_PMI"+mp_id);
			$(".main_morgage"+mp_id+" #propertyTax").addClass("sl_home_loan_propertyTax"+mp_id);
